import React from "react";
import "./Banner.scss";
import BannerImage from "./banner.jpg";

function Banner() {
  return (
    <div className="banner">
      <div className="banner-content">
        <div className="banner-title">Prepare for the future</div>
        <div className="banner-button">Learn More</div>
      </div>
    </div>
  );
}

export default Banner;
